description:
Ashley and Kisha is a documentary on a lesbian couple and their love. Ashley somehow seems to lead their relationship, not least because she has been openly lesbian for quite some time and having had several lovers. But formerly straight girlfriend Kisha also wanted to &amp;#039;go public&amp;#039; with their love through directors Mr and Ms Comstock filming. &amp;#039;Our love needs no argument, no explanation. If a person I know sees this film and discovers this about me (being in a lesbian relationship) there shouldn&amp;#039;t be any questions to ask about why am I this way. I&amp;#039;ll say: &amp;#039;You watched the movie, you tell me instead, why not?&amp;#039;

Shot on real film. Some of the fine film quality is even suggested in the DivX file. Runtime 53 mins approx. About half of it is their story told by them, the rest is pure and very sweet and tender, real love.
